import React from 'react';
import './header.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUserGroup , faEllipsisVertical } from '@fortawesome/free-solid-svg-icons';

const Header = () => {
  return (
    <div className="header">
      <div className="header-options">
        <img src="data:image/jpeg;base64," alt="" className='btn-profile' />
        <div className="header-second">
        <FontAwesomeIcon icon={faUserGroup} className='icons' onClick={(e)=>Navigate('')}/>
        <FontAwesomeIcon icon={faEllipsisVertical} className='icons' />
      </div>
      </div>
    </div>
  );
};

export default Header;
